INSERT INTO `mail` VALUES (312,'aZKD2pkVIXszqcfi','dasf','','2022-04-07 08:45:55.131000',1,0,'justify','0','','','Y','GENERAL','https://culetter.s3.ap-northeast-2.amazonaws.com/music/027.mp3','alonemint@naver.com','강민수','alonemint@gmail.com',7,'강민수찐','{}','https://culetter.s3.ap-northeast-2.amazonaws.com/letter_image/output_86.png','fsa',1,0,'N',20,'Forgotten Memories'),(313,'3crmEobKMjklpRIX','이 편지는 영국에서 최초로 시작되어 일년에 한바퀴를 돌면서 받는 사람에게 행운을 주었고 지금은 당신에게로 옮겨진 이 편지는 4일 안에 당신 곁을 떠나야 합니다.\n\n이 편지를 포함해서 7통을 행운이 필요한 사람에게 보내 주셔야 합니다. 복사를 해도 좋습니다. 혹 미신이라 하실지 모르지만 사실입니다.\n\n영국에서 John Doe이라는 사람은 1930년에 이 편지를 받았습니다. 그는 비서에게 복사해서 보내라고 했습니다. 며칠 뒤에 복권이 당첨되어 20억을 받았습니다. \n\n어떤 이는 이 편지를 받았으나 96시간 이내 자신의 손에서 떠나야 한다는 사실을 잊었습니다. 그는 곧 사직되었습니다. 나중에야 이 사실을 알고 7통의 편지를 보냈는데 다시 좋은 직장을 얻었습니다. \n\n미국의 케네디 대통령은 이 편지를 받았지만 그냥 버렸습니다. 결국 9일 후 그는 암살당했습니다.\n\n기억해 주세요. 이 편지를 보내면 7년의 행운이 있을 것이고 그렇지 않으면 3년의 불행이 있을 것입니다. \n\n그리고 이 편지를 버리거나 낙서를 해서는 절대로 안됩니다. 7통입니다. 이 편지를 받은 사람은 행운이 깃들것입니다.\n\n힘들겠지만 좋은게 좋다고 생각하세요. 7년의 행운을 빌면서...','','2022-04-07 08:46:30.974000',2,6,'justify','7','','','Y','GENERAL','https://culetter.s3.ap-northeast-2.amazonaws.com/music/001.mp3','test@ssafy.com','김도현','wind9481@naver.com',40,'정유환','{}','https://culetter.s3.ap-northeast-2.amazonaws.com/letter_image/output_1.png','행운의 편지',1,0,'N',13,'Acoustic Folk'),(315,'8Y5rwVpThn5Vpqqz','J 스치는 바람에 J 그대 모습 보이면\n난 오늘도 조용히 그대를 그리워하네\n\nJ 지난 밤 꿈 속에 J 만났던 모습은\n내 가슴 속 깊이 여울져 남아 있네\n\nJ 아름다운 여름날이 멀리 사라졌다 해도\nJ 나의 사랑은 아직도 변함없는데\nJ 난 너를 못 잊어 J 난 너를 사랑해\n\nJ 우리가 걸었던 J 추억의 그 길을\n난 이 밤도 쓸쓸히 쓸쓸히 걷고 있네\n\nJ 아름다운 여름날이 멀리 사라졌다 해도\nJ 나의 사랑은 아직도 변함없는데\nJ 난 너를 못 잊어 J 난 너를 사랑해\n\nJ 우리가 걸었던 J 추억의 그 길을\n난 이 밤도 쓸쓸히 쓸쓸히 걷고 있네\n\n쓸쓸히 걷고 있네','','2022-04-07 08:50:49.463000',1,0,'justify','0','','','N','GENERAL','https://culetter.s3.ap-northeast-2.amazonaws.com/music/011.mp3','','','test@ssafy.com',42,'김도현','{}','https://culetter.s3.ap-northeast-2.amazonaws.com/letter_image/output_45.png','J에게 (feat. Java, Jenkins, intelliJ, Javascript)',1,0,'N',20,'Bringing Memories'),(317,'vr94mOh8cNH2M0vb','결혼합니다.\n저희 두 사람이 사랑과 믿음으로 \n한 가정을 이루게 되었습니다.\n꼭 오셔서 밝은 미소와 힘찬 박수로\n축복해주시면 더 없는 기쁨으로 간직하겠습니다.','','2022-04-07 08:52:47.559000',2,NULL,'','','','','Y','GENERAL','',NULL,'','test@ssafy.com',42,'김도현','',NULL,'나와의 결혼',NULL,NULL,'N',NULL,NULL),(318,'o0kh0LMm93dNCt3B','fas','','2022-04-07 08:57:09.893000',2,0,'justify','0','','','Y','PHOTOCARD','https://culetter.s3.ap-northeast-2.amazonaws.com/music/027.mp3','alonemint@gmail.com','강민수찐','alonemint@naver.com',31,'강민수','[{\"idx\":999,\"type\":\"text\",\"content\":\"fas\",\"position\":{\"x\":0,\"y\":0},\"disabled\":true},{\"idx\":998,\"type\":\"title\",\"content\":\"dafsafasdas\",\"position\":{\"x\":0,\"y\":0},\"disabled\":true}]','https://culetter.s3.ap-northeast-2.amazonaws.com/photocard_image/output_30.png','dafsafasdas',1,0,'N',20,'Forgotten Memories'),(319,'IyDhO2rH0ogYKYhh','어우러','','2022-04-07 09:01:19.183000',1,0,'justify','0','','','Y','GENERAL','https://culetter.s3.ap-northeast-2.amazonaws.com/music/011.mp3','alonemint@naver.com','강민수','alonemint@gmail.com',7,'강민수찐','{}','https://culetter.s3.ap-northeast-2.amazonaws.com/letter_image/output_45.png','ㅑㅇ어우',1,0,'N',20,'Bringing Memories'),(321,'s3TS1Xbl7uxPWnKu','나 너에게 할 말이 있어.\n\n나 배가 고파.\n밥 먹으러 가고 싶어.\n\n뱃가죽 달라 붙겠어.\n밥 먹으러 가자.','','2022-04-07 09:29:24.665000',1,0,'center','10','','','Y','PHOTOCARD','https://culetter.s3.ap-northeast-2.amazonaws.com/music/037.mp3','','','alonemint@gmail.com',7,'강민수','[{\"idx\":999,\"type\":\"text\",\"content\":\"나 너에게 할 말이 있어.\\n\\n나 배가 고파.\\n밥 먹으러 가고 싶어.\\n\\n뱃가죽 달라 붙겠어.\\n밥 먹으러 가자.\",\"position\":{\"x\":47,\"y\":138},\"disabled\":true},{\"idx\":998,\"type\":\"title\",\"content\":\"창현이에게\",\"position\":{\"x\":-47,\"y\":-198},\"disabled\":true},{\"idx\":0,\"type\":\"sticker\",\"content\":{\"icon\":{\"type\":{},\"compare\":null},\"color\":\"#FD5D5D\",\"idx\":1},\"position\":{\"x\":-117,\"y\":-215},\"disabled\":true},{\"idx\":1,\"type\":\"sticker\",\"content\":{\"icon\":{\"type\":{},\"compare\":null},\"color\