고 지금은 당신에게로 옮겨진 이 편지는 4일 안에 당신 곁을 떠나야 합니다.\n\n이 편지를 포함해서 7통을 행운이 필요한 사람에게 보내 주셔야 합니다. 복사를 해도 좋습니다. 혹 미신이라 하실지 모르지만 사실입니다.\n\n영국에서 John Doe이라는 사람은 1930년에 이 편지를 받았습니다. 그는 비서에게 복사해서 보내라고 했습니다. 며칠 뒤에 복권이 당첨되어 20억을 받았습니다.\n\n어떤 이는 이 편지를 받았으나 96시간 이내 자신의 손에서 떠나야 한다는 사실을 잊었습니다. 그는 곧 사직되었습니다. 나중에야 이 사실을 알고 7통의 편지를 보냈는데 다시 좋은 직장을 얻었습니다.\n\n미국의 케네디 대통령은 이 편지를 받았지만 그냥 버렸습니다. 결국 9일 후 그는 암살당했습니다.\n\n기억해 주세요. 이 편지를 보내면 7년의 행운이 있을 것이고 그렇지 않으면 3년의 불행이 있을 것입니다.\n\n그리고 이 편지를 버리거나 낙서를 해서는 절대로 안됩니다. 7통입니다. 이 편지를 받은 사람은 행운이 깃들것입니다.\n\n힘들겠지만 좋은게 좋다고 생각하세요. 7년의 행운을 빌면서...','','2022-04-07 12:55:13.606000',2,6,'left','7','','','Y','GENERAL','https://culetter.s3.ap-northeast-2.amazonaws.com/music/001.mp3','','','wind9481@naver.com',40,'정유환','{}','https://culetter.s3.ap-northeast-2.amazonaws.com/letter_image/output_1.png','행운의 편지',1,0,'N',14,'Acoustic Folk'),(340,'GVTlDYKTLzp2sgyz','','','2022-04-07 15:43:13.656000',1,NULL,'','','','','N','PHOTOCARD','','','','psa9456@naver.com',44,'화이팅','',NULL,'우와',NULL,NULL,'N',NULL,NULL),(341,'AZhig8kQii3ik8wV','안녕 만나서 반가워','','2022-04-07 15:56:04.706000',1,0,'justify','0','','','Y','POSTCARD','https://culetter.s3.ap-northeast-2.amazonaws.com/music/012.mp3','','','ironylovely@naver.com',45,'김싸피','{}','https://culetter.s3.ap-northeast-2.amazonaws.com/postcard_image/output_51.png','안녕하세요',1,0,'N',20,'Space Travel'),(342,'MF6o6pxRRRo3YWXb','다들 취준과 병행하시느라 7주 동안 수고 많았습니다. 싸피도 거의 끝이네요ㅜㅜ\n자율 프로젝트도 다들 잘 끝내세요!! \n싸피 끝나기 전에 다들 취뽀하길~.~','','2022-04-07 16:33:58.721000',2,1,'justify','3','','','Y','PHOTOCARD','https://culetter.s3.ap-northeast-2.amazonaws.com/music/001.mp3','','','mapleapril@naver.com',32,'이름바꾸','[{\"idx\":999,\"type\":\"text\",\"content\":\"다들 취준과 병행하시느라 7주 동안 수고 많았습니다. 싸피도 거의 끝이네요ㅜㅜ\\n자율 프로젝트도 다들 잘 끝내세요!! \\n싸피 끝나기 전에 다들 취뽀하길~.~\",\"position\":{\"x\":0,\"y\":-113},\"disabled\":true},{\"idx\":998,\"type\":\"title\",\"content\":\"특화 프로젝트 끝!!\",\"position\":{\"x\":71,\"y\":195},\"disabled\":true},{\"idx\":0,\"type\":\"sticker\",\"content\":{\"icon\":{\"