랑 고백 해볼까 (해볼까)\n창문 너머로 너를 계속 불러보고 있어\n이렇게 너랑 나 우리 둘의 사이가\n조금 더 좁혀지길 기대하고 싶은 밤\n떨려오는 별빛 반짝이는데\n넌 어디를 보고 있는지\n금방이라도 사라질 것 같은데\n기다렸던 시간이 지나고\n이제 보내줄게 아냐 아직은\n너를 내방에 몰래 몰래 간직하고 싶어\n다가가기엔 너의 맘이 확실하지 않아\n망설여지지만 여기 있기엔\n너무 좋아져버린 내 맘 볼 수 없으니까\n지금이 며칠째 훌쩍이는데\n넌 어디로 가고 있는지\n당장이라도 따라가고 싶은데\n기다렸던 순간 오늘이\n모두 다 지나고\n하염없이 너를 쫓았던 밤\n손에 닿지 않는 니가 보고 싶은 밤\n밤밤밤에 밤하늘을 날아\nAs time time for the moon night\n꿈 속에서 너를 만나','','2022-04-07 16:36:37.878000',2,18,'center','5','','','Y','GENERAL','https://culetter.s3.ap-northeast-2.amazonaws.com/music/003.mp3','','','mapleapril@naver.com',32,'이름바꾸','[{\"idx\":999,\"type\":\"text\",\"content\":\"다들 취준과 병행하시느라 7주 동안 수고 많았습니다. 싸피도 거의 끝이네요ㅜㅜ\\n자율 프로젝트도 다들 잘 끝내세요!! \\n싸피 끝나기 전에 다들 취뽀하길~.~\",\"position\":{\"x\":0,\"y\":-113},\"disabled\":true},{\"idx\":998,\"type\":\"title\",\"content\":\"특화 프로젝트 끝!!\",\"position\":{\"x\":71,\"y\":195},\"disabled\":true},{\"idx\":0,\"type\":\"sticker\",\"content\":{\"icon\":{\"type\":{},\"compare\":null},\"color\":\"#FFD93D\",\"idx\":2},\"position\":{\"x\":106,\"y\":145},\"disabled\":true},{\"idx\":1,\"type\":\"sticker\",\"content\":{\"icon\":{\"type\":{},\"compare\":null},\"color\":\"#E4AEC5\",\"idx\":3},\"position\":{\"x\":-120,\"y\":159},\"disabled\":true},{\"idx\":2,\"type\":\"sticker\",\"content\":{\"icon\":{\"type\":{},\"compare\":null},\"color\":\"#FD5D5D\",\"idx\":1},\"position\":{\"x\":-148,\"y\":-214},\"disabled\":true},{\"idx\":3,\"type\":\"sticker\",\"content\":{\"icon\":{\"type\":{},\"compare\":null},\"color\":\"#FF8080\",\"idx\":7},\"position\":{\"x\":-41,\"y\":190},\"disabled\":true},{\"idx\":4,\"type\":\"sticker\",\"content\":{\"icon\":{\"type\":{},\"compare\":null},\"color\":\"#FFD93D\",\"idx\":8},\"position\":{\"x\":89,\"y\":-32},\"disabled\":true},{\"idx\":5,\"type\":\"sticker\",\"content\":{\"icon\":{\"type\":{},\"compare\":null},\"color\":\"#FFD93D\",\"idx\":8},\"position\":{\"x\":63,\"y\":-32},\"disabled\":true},{\"idx\":6,\"type\":\"sticker\",\"content\":{\"icon\":{\"type\":{},\"compare\":null},\"