\":\"title\",\"content\":\"편지\",\"position\":{\"x\":-11,\"y\":-217},\"disabled\":true},{\"idx\":0,\"type\":\"sticker\",\"content\":{\"icon\":{\"type\":{},\"compare\":null},\"color\":\"#A12568\",\"idx\":6},\"position\":{\"x\":6,\"y\":-229},\"disabled\":true}]','https://culetter.s3.ap-northeast-2.amazonaws.com/photocard_image/output_29.png','편지',10,0,'N',12,'Acoustic Folk'),(346,'bx2DaUZ0Ee3MFZyg','오빠... 경포대에는 달이 네개가 뜬대... 왜인줄 알아?\n\n첫번째는 하늘에 뜬 달 하나, 두번째는 바다에 비추는 달 하나, 세번째 달은 우리 술잔에 비추는 달 하나, 마지막은 오빠 눈에 비춘 달 하나...\n\n오늘 벚꽃이 피었더라.. 작년에 같이 호수공원 기억나? 진짜 좋았는데 ㅎㅎ \n\n오빠... 우리 헤어지자...\n\n나 너무 힘들어.. 오빠는 진짜 좋은사람이야...\n나에게 과분할 정도로, 항상 너무 고마웠고..\n나 없어도 밥 잘 챙겨먹고 힘들어 하지 않았으면 좋겠어 나보다 훨씬 좋은 사람 만났으면 좋겠다 \n\n안녕! 행복했으면 좋겠다 답장 안해도 돼 !!','','2022-04-07 17:04:40.549000',2,0,'center','3','','','Y','POSTCARD','https://culetter.s3.ap-northeast-2.amazonaws.com/music/001.mp3','alonemint@naver.com','강민수우','godooly@doo.ly',10,'고둘리','{}','https://culetter.s3.ap-northeast-2.amazonaws.com/postcard_image/output_15.png','오빠에게.. ',10,10,'N',20,'Acoustic Folk'),(349,'E1xFbVwFpcIO7n9c','ㅇㅀ','','2022-04-07 20:30:30.540000',1,0,'justify','0','','','Y','PHOTOCARD','https://culetter.s3.ap-northeast-2.amazonaws.com/music/011.mp3','godooly@doo.ly','고둘리','mapleapril@naver.com',32,'김은송','[{\"idx\":999,\"type\":\"text\",\"content\":\"ㅇㅀ\",\"position\":{\"x\":0,\"y\":0},\"disabled\":false},{\"idx\":998,\"type\":\"title\",\"content\":\"ㅇㅀ\",\"position\":{\"x\":0,\"y\":0},\"disabled\":false}]','https://culetter.s3.ap-northeast-2.amazonaws.com/photocard_image/output_23.png','ㅇㅀ',1,0,'N',20,'Bringing Memories'),(351,'SrgYeL8AcT29Ektu','ㄷ','','2022-04-07 20:54:54.573000',1,0,'justify','0','','','Y','PHOTOCARD','https://culetter.s3.ap-northeast-2.amazonaws.com/music/011.mp3','godooly@doo.ly','고둘리','mapleapril@naver.com',32,'김은송','[{\"idx\":999,\"type\":\"text\",\"content\":\"ㄷ\",\"position\":{\"x\":0,\"y\":0},\"disabled\":false},{\"idx\":998,\"type\":\"title\",\"content\":\"ㄷ\",\"position\":{\"x\":0,\"y\":0},\"disable